  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Malheur National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1947. The report begins by summarizing the weather conditions, water conditions,
  and wildfires during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, raptors, fish, and disease-
  is also covered. The Refuge development and maintenance section discusses physical
  developments. Resource management is outlined; topics include grazing. The public
  relations section of the report describes recreational uses, Refuge visitors, hunting,
  fishing, and violations. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
